    "Fast, modern and advanced photo management suite" : "تېز ، زامانىۋى ۋە ئىلغار رەسىم باشقۇرۇش يۈرۈشلۈكلىرى",
    "# Memories: Photo Management for Nextcloud\n\nMemories is a *batteries-included* photo management solution for Nextcloud with advanced features including:\n\n- **📸 Timeline**: Sort photos and videos by date taken, parsed from Exif data.\n- **⏪ Rewind**: Jump to any time in the past instantly and relive your memories.\n- **🤖 AI Tagging**: Group photos by people and objects, powered by [recognize](https://github.com/nextcloud/recognize) and [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Albums**: Create albums to group photos and videos together. Then share these albums with others.\n- **🫱🏻‍🫲🏻 External Sharing**: Share photos and videos with people outside of your Nextcloud instance.\n- **📱 Mobile Support**: Work from any device, of any shape and size through the web app.\n- **✏️ Edit Metadata**: Edit dates and other metadata on photos quickly and in bulk.\n- **📦 Archive**: Store photos you don't want to see in your timeline in a separate folder.\n- **📹 Video Transcoding**: Transcode videos and use HLS for maximal performance.\n- **🗺️ Map**: View your photos on a map, tagged with accurate reverse geocoding.\n- **📦 Migration**: Migrate easily from Nextcloud Photos and Google Takeout.\n- **⚡️ Performance**: Do all this very fast.\n\n## 🚀 Installation\n\n1. Install the app from the Nextcloud app store (try a demo [here](https://demo.memories.gallery/apps/memories/)).\n1. Perform the recommended [configuration steps](https://memories.gallery/config/).\n1. Run `php occ memories:index` to generate metadata indices for existing photos.\n1. Open the 📷 Memories app in Nextcloud and set the directory containing your photos." : "# ئەسلىمىلەر: Nextcloud ئۈچۈن رەسىم باشقۇرۇش\n\nئىچكى ساقلىغۇچ Nextcloud ئۈچۈن * باتارېيەنى ئۆز ئىچىگە ئالغان * رەسىم باشقۇرۇش چارىسى بولۇپ ، تۆۋەندىكىلەرنى ئۆز ئىچىگە ئالىدۇ:\n\n- ** 📸 ۋاقىت جەدۋىلى **: تارتىلغان ۋاقىت ۋە رەسىم ۋە سىنلارنى Exif سانلىق مەلۇماتلىرىدىن تەھلىل قىلىڭ.\n- ** ⏪ مۇكاپاتلاش **: ئۆتمۈشتىكى ھەر قانداق ۋاقىتتا دەرھال سەكرەپ ، ئەسلىمىلىرىڭىزنى ئەسلەڭ.\n** ).\n- ** 🖼️ پىلاستىنكا **: گۇرۇپپا رەسىم ۋە سىنلارنى گۇرۇپپا قىلىپ پىلاستىنكا قۇرۇڭ. ئاندىن بۇ پىلاستىنكىلارنى باشقىلار بىلەن ئورتاقلىشىڭ.\n- ** ternal سىرتقى ئورتاقلىشىش **: Nextcloud مىسالىڭىزنىڭ سىرتىدىكى كىشىلەر بىلەن رەسىم ۋە سىنلارنى ھەمبەھىرلەڭ.\n- ** 📱 كۆچمە قوللاش **: تور دېتالى ئارقىلىق ھەر قانداق ئۈسكۈنىدە ، ھەر قانداق شەكىلدە ئىشلەڭ.\n- ** Met مېتا سانلىق مەلۇماتنى تەھرىرلەش **: چېسلا ۋە باشقا مېتا سانلىق مەلۇماتلارنى سۈرەتلەردە تېز ۋە كۆپلەپ تەھرىرلەڭ.\n- ** 📦 ئارخىپ **: ۋاقىت جەدۋىلىدە كۆرۈشنى خالىمايدىغان رەسىملەرنى ئايرىم قىسقۇچتا ساقلاڭ.\n- ** 📹 سىن كودلاش **: سىنلارنى كودلاش ۋە HLS نى ئەڭ يۇقىرى ئۈنۈمدە ئىشلىتىش.\n- ** 🗺️ خەرىتە **: رەسىمىڭىزنى خەرىتىدە كۆرۈڭ ، توغرا تەتۈر جۇغراپىيىلىك بەلگە قويۇلغان.\n- ** 📦 كۆچۈش **: Nextcloud رەسىملىرى ۋە Google Takeout دىن ئاسانلا كۆچۈڭ.\n- ** ⚡️ ئىقتىدار **: بۇلارنىڭ ھەممىسىنى ناھايىتى تېز قىلىڭ.\n\n## 🚀 قاچىلاش\n\n1. بۇ ئەپنى Nextcloud ئەپ دۇكىنىدىن قاچىلاڭ (بۇ يەردە ئۈلگە كۆرسىتىش (https://demo.memories.gallery/apps/memories/)).\n1. تەۋسىيە قىلىنغان [سەپلىمە قەدەم باسقۇچلىرىنى] ئىجرا قىلىڭ (https://memories.gallery/config/).\n1.\n1. Nextcloud دىكى 📷 ئىچكى ساقلىغۇچ دېتالىنى ئېچىڭ ھەمدە سۈرىتىڭىزنى ئۆز ئىچىگە ئالغان مۇندەرىجىنى تەڭشەڭ.",
